import React, { useState } from "react";
import img15 from './image/img15.webp';
import styled from "styled-components";
import { Dropdown, Modal, Button } from "react-bootstrap";
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import img16 from './image/img16.png';
import img17 from './image/img17.webp';
import img18 from './image/img18.webp';
import img19 from './image/img19.webp';
import img20 from './image/img20.webp';
import img21 from './image/img21.webp';
import Carousel from 'react-bootstrap/Carousel';
import { CarouselItem } from 'react-bootstrap';

function Details() {
  const [value, setValue] = useState('offer');
  const [showMembershipModal, setShowMembershipModal] = useState(false);
  const [selectedMembership, setSelectedMembership] = useState(null);

  const handleChange = (event) => {
    setValue(event.target.value);
  };

  const handleMembershipClose = () => setShowMembershipModal(false);
  const handleMembershipShow = () => setShowMembershipModal(true);

  const handleMembershipSelect = (membership) => {
    setSelectedMembership(membership);
  };

  return (
    <div>
      <Design4>
        <div className='boxx d-flex'>
          <div className='w-25 mt-2 ms-3 ps-4 pe-4'>
            <div className='w-100 mt-5 ms-1 ps-4 pe-4 border shadow'>
              <h4 className="mt-2">Overview of Dolo 650 Tablet</h4>
              <p>Uses and benefits</p>
              <p>Side effects</p>
              <p>How to use</p>
              <p>How drug works</p>
              <p>Safety advice</p>
              <p>Missed dose</p>
              <p>Alternate Brands of Dolo 650 Tablet</p>
              <p>Quick tips</p>
              <p>Fact box</p>
              <p>Interaction with drugs</p>
              <p>Patient concerns</p>
            </div>
            <div className='w-100 mt-4 ms-1 ps-4 pe-4 border shadow'>
              <h6 className="mt-3">Note</h6>
              <p>Consult the doctor if any of these side effects persist or become bothersome...</p>
            </div>
          </div>
          <div className="div w-50">
            <div className='d-flex border shadow w-100 mt-5 ms-2 me-2 px-4'>
              <Design1>
                <div className='box mt-5 ms-4'>
                  <h6 className="text-black">Dolo 650 Tablet</h6>
                  <h6>MARKETER</h6>
                  <p>Micro Labs Ltd</p>
                  <h6>SALT COMPOSITION</h6>
                  <p>Paracetamol (650mg)</p>
                  <h6>SALT SYNONYMS</h6>
                  <p>Acetaminophen</p>
                  <h6>STORAGE</h6>
                  <p>Store below 25°C</p>
                  <p className="text-danger mb-4">Click here to view all substitutes</p>
                </div>
              </Design1>
              <div className="w-50">
                <Design>
                  <Carousel>
                    <CarouselItem>
                      <img className="img w-75 h-75" alt='homeimages' src={img15} />
                    </CarouselItem>
                    <CarouselItem>
                      <img className="img w-75 h-75" alt='homeimages' src={img17} />
                    </CarouselItem>
                    <CarouselItem>
                      <img className="mg w-75 h-75 mt-4" alt='homeimages' src={img18} />
                    </CarouselItem>
                    <CarouselItem>
                      <img className="mg w-75 h-75 mt-4" alt='homeimages' src={img19} />
                    </CarouselItem>
                    <CarouselItem>
                      <img className="mg w-75 h-75 mt-4" alt='homeimages' src={img20} />
                    </CarouselItem>
                    <CarouselItem>
                      <img className="mg w-50 h-50 mt-4" alt='homeimages' src={img21} />
                    </CarouselItem>
                  </Carousel>
                </Design>
              </div>
            </div>
            <div className="boxx border shadow w-100 mt-4 ms-2 me-2 px-4">
              <h6 className="mt-3">PRODUCT INTRODUCTION</h6>
              <p>PRODUCT INTRODUCTION Dolo 650 Tablet helps relieve pain and fever...</p>
            </div>
            <div className="box border shadow ms-2 me-2 w-100 mt-4 px-4">
              <h6 className="mt-3">BENEFITS OF DOLO 650 TABLET</h6>
              <p>In Pain relief</p>
              <CustomFontText>
                Dolo 650 Tablet is a common painkiller for treating aches and pains...
              </CustomFontText>
            </div>
            <div className="box border shadow ms-2 me-2 w-100 mt-4 px-4">
              <h6 className="mt-3">SIDE EFFECTS OF DOLO 650 TABLET</h6>
              <CustomFontText>
                Most side effects do not require any medical attention...
              </CustomFontText>
              <button className="rounded-3 bg-body-secondary mb-2">Common side effects of Dolo 650 Tablet</button>
              <CustomFontText>
                <li>Stomach pain</li>
                <li>Nausea</li>
                <li>Vomiting</li>
              </CustomFontText>
            </div>
          </div>
          {/* Moved SUBSTITUTES section */}
          <div className='w-25 box mt-5 ms-4'>
            <div className="border border-1 m-lg-2">
              <div className="d-flex bg-light">
                <img className="mt-3 ms-1" src={img16} alt="product" />
                <p className="px-2 mt-3">12,313 people bought this recently</p>
              </div>
              <FormControl>
                <div className="px-3">
                  <FormLabel className="demo-controlled-radio-buttons-group"></FormLabel>
                  <RadioGroup
                    aria-labelledby="demo-controlled-radio-buttons-group"
                    name="controlled-radio-buttons-group"
                    value={value}
                    onChange={handleChange}
                  >
                    <FormControlLabel value="offer" control={<Radio />} label="₹24.65 Get 27% OFF" />
                    <FormControlLabel value="offer1" control={<Radio />} label="₹23.49 + free shipping with Care Plan" />
                  </RadioGroup>
                </div>
              </FormControl>
              <p className="px-4 mt-3 fw-light">Inclusive of all taxes...</p>
              <Design3>
                <div className="d-flex">
                  <Dropdown>
                    <Dropdown.Toggle className='dropdown-basic mt-4 ms-4 mb-4'>
                      1 strip
                    </Dropdown.Toggle>
                    <Dropdown.Menu>
                      <Dropdown.Item>1 strip</Dropdown.Item>
                      <Dropdown.Item>2 strips</Dropdown.Item>
                      <Dropdown.Item>3 strips</Dropdown.Item>
                    </Dropdown.Menu>
                  </Dropdown>
                  <p className="ms-5 mt-4">15.0 tablets in 1 strip</p>
                </div>
              </Design3>
              <button className="btn btn-warning fs-6 w-75 me-1 ms-4" onClick={() => window.location.replace('/cartdeets')}>Add to Cart</button>
              <button className="btn btn-outline-primary fs-6 w-75 me-1 ms-4 mt-2" onClick={handleMembershipShow}>Add Membership</button>
              <p className="mt-3 ms-4">Cash on delivery available</p>
            </div>
          </div>
        </div>
      </Design4>

      {/* Modal for Membership */}
      <Modal show={showMembershipModal} onHide={handleMembershipClose}>
        <Modal.Header closeButton>
          <Modal.Title>Membership Options</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>Select a membership plan to enjoy extra benefits:</p>
          <ul>
            <li><Button variant="link" onClick={() => handleMembershipSelect('Silver Membership - ₹99/month')}>Silver Membership - ₹99/month</Button></li>
            <li><Button variant="link" onClick={() => handleMembershipSelect('Gold Membership - ₹199/month')}>Gold Membership - ₹199/month</Button></li>
            <li><Button variant="link" onClick={() => handleMembershipSelect('Platinum Membership - ₹299/month')}>Platinum Membership - ₹299/month</Button></li>
          </ul>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleMembershipClose}>
            Close
          </Button>
          <Button variant="primary" onClick={() => { 
            if (selectedMembership) {
              alert(`Membership '${selectedMembership}' added successfully!`);
              handleMembershipClose();
            } else {
              alert("Please select a membership plan.");
            }
          }}>
            Add Membership
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Details;

const Design = styled.div`
  .img {
    width: 55%;
    margin-top: 100px;
    margin-left: 70px;
  }
`;

const Design4 = styled.div`
  .boxx {
    margin-top: 180px;
  }
`;

const Design1 = styled.div`
  .box {
    width: 75%;
    color: dark-grey;
  }
`;

const Design3 = styled.div`
  .dropdown-basic {
    background-color: whitesmoke;
    color: black;
    width: 120%;
  }
`;

const CustomFontText = styled.p`
  font-family: 'Arial, sans-serif'; /* Replace with your desired font */
`;
